import React from 'react'

function Navegation() {
  const list=['Examenes','Pacientes','Registro']
  return (
    <div className='w-2/12 bg-green-primary'>
        <ol>
            {list.map(elemet=>{
            return(
              <div>
                <li className='p-2 text-center text-xl text-white bg-gray-700 bg-opacity-40  uppercase hover:bg-opacity-0'>{elemet}</li>
                <hr className='w-5/6 ' />
              </div>
            )})}
        </ol>
    </div>
  )
}

export default Navegation
